        /// <summary>
        /// 获取关系表的 CSV 表格。
        /// </summary>
        /// <returns></returns>
        public static string GetCSV()
        {
            StringBuilder sb = new StringBuilder();
            double b = 4d;
            sb.Append(',');
            for (int i = 0; i < 141; i++)
            {
                sb.Append(i < 141 ? b.ToString("f1", CultureInfo.InvariantCulture) + "," : b.ToString("f1", CultureInfo.InvariantCulture));
                b += 0.1d;
            }
            sb.AppendLine();
            double rd = 90d;
            for (int i = 0; i < 501; i++)
            {
                sb.Append(rd.ToString("f1", CultureInfo.InvariantCulture) + ",");
                for (int j = 0; j < 141; j++)
                {
                    sb.Append(j < 141 ? _table[i, j].ToString(CultureInfo.InvariantCulture) + "," : _table[i, j].ToString(CultureInfo.InvariantCulture));
                }
                if (i < 501)
                {
                    sb.AppendLine();
                }
                rd -= 0.1d;
            }
            return sb.ToString();
        }

        /// <summary>
        /// 指定反射率（Rd）和黄色深度（+b），获取颜色级的值。
        /// </summary>
        /// <param name="rd">反射率。Lab 值中的 L。</param>
        /// <param name="b">黄色深度。Lab 值中的 b。</param>
        /// <returns></returns>
        /// <exception cref="Exception" />
        [System.Diagnostics.CodeAnalysis.SuppressMessage("Usage", "CA2201:不要引发保留的异常类型", Justification = "<挂起>")]
        public static byte GetGrade(double rd, double b)
        {
            b = Math.Round(b, 1);
            rd = Math.Round(rd, 1);
            if (b < 4d || b > 18d)
            {
                throw new Exception("指定的黄色深度（+b）超出有效范围。");
            }
            if (rd < 40d || rd > 90d)
            {
                throw new Exception("指定的反射率（Rd）超出有效范围。");
            }
            int x = (int)(b * 10d) - 40;
            int y = 500 - ((int)(rd * 10d) - 400);
            return _table[y, x];
        }

        /// <summary>
        /// 获取颜色级数字值对应的中文名称。
        /// </summary>
        /// <param name="value">颜色级数字值。</param>
        /// <returns></returns>
        /// <exception cref="Exception" />
        [System.Diagnostics.CodeAnalysis.SuppressMessage("Usage", "CA2201:不要引发保留的异常类型", Justification = "<挂起>")]
        public static string GetName(byte value)
        {
            switch (value)
            {
                case 11: return "白棉1级";
                case 21: return "白棉2级";
                case 31: return "白棉3级";
                case 41: return "白棉4级";
                case 51: return "白棉5级";
                case 12: return "淡点污棉1级";
                case 22: return "淡点污棉2级";
                case 32: return "淡点污棉3级";
                case 13: return "淡黄染棉1级";
                case 23: return "淡黄染棉2级";
                case 33: return "淡黄染棉3级";
                case 14: return "黄染棉1级";
                case 24: return "黄染棉2级";
                default: throw new Exception("指定的颜色级的值不是有效的值。");
            }
        }
    }
